import React, { useState } from 'react'
import {AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai";
import toast from 'react-hot-toast';
import { useNavigate } from 'react-router-dom';

const SignupForm = ({setIsLoggedIn}) => {
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        firstName:"",
        lastName:"",
        email:"",
        password:"",
        confirmPassword:""
    })

     const [showPassword, setShowPassword] = useState(false);
 
    function changeHandler(event) {
        setFormData( (prevData) => (
            {
                ...prevData,
                [event.target.name]:event.target.value
            }
        ))
    }

    function submitHandler(event) {
        event.preventDefault();
        if(formData.password !== formData.confirmPassword) {
            toast.error("Passwords do not match");
            return;
        }
    

     setIsLoggedIn(true);
     toast.success("Account Created");
     const accountData = {
        ...formData
     };
     console.log("Printing account data");
     console.log(accountData);

    navigate("/dashboard");

    }
  return (
    <div>
        {/* student-Instructor tab */}
        <div>
            <button>
                Student
            </button>
            <button>
                Instructor
            </button>

            <form onSubmit={submitHandler}>
            {/* first name and last name  */}
            <div className='flex justify-between'>

                <label>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>First Name<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="text"
                    name="firstName"
                    onChange={changeHandler}
                    placeholder="Enter First Name"
                    value={formData.firstName}
                    className='bg-black rounded-[0.5rem] text-black w-full p-[12px]'

                    />
                </label>

                <label>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Last Name<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="text"
                    name="lastName"
                    onChange={changeHandler}
                    placeholder="Enter Last Name"
                    value={formData.lastname}
                    className='bg-black rounded-[0.5rem] text-black w-full p-[12px]'

                    />
                </label>
            </div>

            {/* Email Address  */}
                <label className='w-full '>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]' >Email Address<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="email"
                    name="email"
                    onChange={changeHandler}
                    placeholder="Enter Email Address"
                    value={formData.email}
                    className='bg-black rounded-[0.5rem] text-black w-full p-[12px]'


                    />
                </label>

            {/* create password and Confirm Password  */}
            <div className='w-full flex gap-x-4 mx-0'>
            <label className='relative'>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Create Password<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type={showPassword ? ("text") : ("password")}
                    name="password"
                    onChange={changeHandler}
                    placeholder="Enter password"
                    value={formData.password}
                    className='bg-black rounded-[0.5rem] text-black w-full p-[12px]'

                    />
                    <span className='absolute right-3 top-[38px] cursor-pointer'
                     onClick={() => setShowPassword((prev) => !prev)}>
                {showPassword ?

                 (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF' />) :  

                  (<AiOutlineEye fontSize={24} fill='#AFB2BF' />)}
            </span>
                </label>

                <label className='relative'>
                    <p  className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Confirm Password<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type={showPassword ? ("text") : ("password")}
                    name="confirmPassword"
                    onChange={changeHandler}
                    placeholder="Confirm Password"
                    value={formData.confirmPassword}
                    className='bg-black rounded-[0.5rem] text-black w-full p-[12px]'

                    />
                    <span
                    className='absolute right-3 top-[68px] cursor-pointer' 
                    onClick={() => setShowPassword((prev) => !prev)}>
                {showPassword ?

                 (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>) : 

                 (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>)}
            </span>
                </label>


            </div>
  
         <button className=' w-full bg-yellow-50 rounded-[8px] font-medium text-richblack-900 px-[12px] py-[8px] mt-6'>
            Create Account
         </button>
            </form>
        </div>


    </div>
  )
}

export default SignupForm
